import React, { useState} from 'react';
import '../../App.css';
import Footer from '../Footer';
import HeroSection from '../Herosection';
import Navbar from '../Navbar';

function Home(props) {

  const [ check, checkLoginUser] = useState()

  props.updateUser(checkUser)

  return (
    <>
      <Navbar 
      NavPage='Home'
      checkLoginUser= {checkLoginUser}/>
      <HeroSection/>
      <Footer/>
    </>
  );
}

export default Home;
